    runApp();


    return(
        <div>
            <div>Vacation!</div>
            [] = spots().map((spot) => {
                <Card place={spot.place} price={spot.price} timeToGo={spot.timeToGo}/>
            })
        </div>

    )
}

function runApp(){
    console.log("we are running", spots())
};

export default App;
